import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import useMediaQuery from '@mui/material/useMediaQuery';
import PersonAddAltIcon from '@mui/icons-material/PersonAddAlt';
import LogoutIcon from '@mui/icons-material/Logout';
import DeleteSweepIcon from '@mui/icons-material/DeleteSweep';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import IconButton from '@mui/material/IconButton/IconButton';
import ListIcon from '@mui/icons-material/List';
import ApiAccess from '../services/api-access';
import { useHistory } from 'react-router-dom';
import routes from '../helpers/routes';
import Modal from 'react-modal';
import SlideDialog from './MaterialModal';
import { Stack } from '@mui/material';


Modal.setAppElement('#root');

const pages = ['Enregistrement étudiant', 'Vider la base'];
const settings = ['Liste de comptes', 'Profil', 'Deconnexion'];

function AdminNavBar() {

    // Check if the screen size is medium or smaller
    const isMediumScreen = useMediaQuery('(max-width: 800px)');
    const [isLogoutDialogOpen, setLogoutDialog] = React.useState(false);
    const [isClearDialogOpen, setClearDialog] = React.useState(false);

    const LogoutManagement = () => {
        ApiAccess.logout();
        window.location.reload();
        goToPage(routes.connexion);
    }

    const ClearBase = () => {
        ApiAccess.clearBase();
    }

    const history = useHistory();

    const goToPage = (path: any) => {
        history.push(path);
    };

    const openLogoutDialog = () => {
        setLogoutDialog(true);
    }

    const closeLogoutDialog = () => {
        setLogoutDialog(false);
    }

    const openClearDialog = () => {
        setClearDialog(true);
    }

    const closeClearDialog = () => {
        setClearDialog(false);
    }

    return (
        <React.Fragment>
            <AppBar position="static">
                <Container maxWidth="xl">
                    <Toolbar sx={{ justifyContent: 'space-between' }} disableGutters>
                        <Box>
                            {isMediumScreen ? (
                                <React.Fragment>
                                    <IconButton
                                        size="large"
                                        aria-label="add student button"
                                        aria-haspopup="true"
                                        color="inherit"
                                        onClick={() => goToPage(routes.addstudent)}
                                    >
                                        <PersonAddAltIcon />
                                    </IconButton>
                                    <IconButton
                                        size="large"
                                        aria-label="clear base"
                                        aria-haspopup="true"
                                        color="inherit"
                                        onClick={openClearDialog}
                                    >
                                        <DeleteSweepIcon />
                                    </IconButton>
                                </React.Fragment>
                            ) : (
                                <React.Fragment>
                                    <Button key={pages[0]} sx={{ color: 'inherit', mr: 2 }} onClick={() => goToPage(routes.addstudent)}>
                                        {pages[0]}
                                    </Button>
                                    <Button key={pages[1]} sx={{ color: 'inherit', mr: 2 }} onClick={openClearDialog}>
                                        {pages[1]}
                                    </Button>
                                </React.Fragment>
                            )}
                        </Box>

                        <Typography
                            variant="h6"
                            noWrap
                            component="a"
                            onClick={() => goToPage(routes.home)}
                            sx={{
                                fontFamily: 'monospace',
                                fontWeight: 700,
                                color: 'inherit',
                                textDecoration: 'none',
                            }}
                        >
                            Students APP
                        </Typography>
                        <Box>
                            {isMediumScreen ? (
                                <React.Fragment>
                                    
                                    <IconButton
                                        size="large"
                                        aria-label="accounts list"
                                        aria-haspopup="true"
                                        color="inherit"
                                        onClick={() => goToPage("/account/list")}
                                    >
                                        <ListIcon />
                                    </IconButton>
                                    <IconButton
                                        size="large"
                                        aria-label="account update"
                                        aria-haspopup="true"
                                        color="inherit"
                                        onClick={() => goToPage("/profil")}
                                    >
                                        <AccountCircleIcon />
                                    </IconButton>
                                    <IconButton
                                        size="large"
                                        aria-label="deconnection"
                                        aria-haspopup="true"
                                        color="inherit"
                                        onClick={openLogoutDialog}
                                    >
                                        <LogoutIcon />
                                    </IconButton>
                                </React.Fragment>
                            ) : (
                                <Stack spacing={1} direction="row">
                                    <Button key={settings[0]} sx={{ color: 'inherit'}} onClick={() => goToPage("/account/list")}>
                                        {settings[0]}
                                    </Button>
                                    <Button key={settings[1]} sx={{ color: 'inherit'}} onClick={() => goToPage("/profil")}>
                                        {settings[1]}
                                    </Button>
                                    <Button key={settings[2]} sx={{ color: 'inherit'}} onClick={openLogoutDialog}>
                                        {settings[2]}
                                    </Button>
                                </Stack>
                            )}
                        </Box>
                    </Toolbar>
                </Container>
            </AppBar>

            <SlideDialog isOpen={isLogoutDialogOpen} onClose={closeLogoutDialog} onConfirm={LogoutManagement} title={'Deconnexion'}>
                <p>Vous allez vous déconnecter</p>
                <p>Êtes vous sûr de continuer ?</p>
            </SlideDialog>

            <SlideDialog isOpen={isClearDialogOpen} onClose={closeClearDialog} onConfirm={ClearBase} title={'Vider la base'}>
                <p>Vous allez vider la base de donnée</p>
                <p>Cette action est irreversible</p>
                <p>Êtes vous sûr de vouloir continuer ?</p>
            </SlideDialog>
        </React.Fragment>
    );
}
export default AdminNavBar;
